var Centauri = {} || Centauri;
CentauriCoreFunctions();

Centauri.Event = {};
Centauri.Component = {};
Centauri.Section = {};
Centauri.Service = {};
Centauri.Utility = {};

Centauri.Breakpoint = "";

Centauri.Utility.ContentElementUtility = (ceName) => {
    return $("[data-contentelement='" + ceName + "']");
};

window.onload = () => {
    $.ajaxSetup({
        headers: {
            "X-CSRF-TOKEN": $("meta[name='csrf-token']").attr("content")
        }
    });

    Centauri.Event.OnWindowLoadEvent();

    document.addEventListener("DOMContentLoaded", () => {
        Centauri.Service.LazyLoadService();
    });
};

Centauri.Component.ATagComponent = () => {
    $("a").off("click");

    $("a").on("click", this, function(e) {
        e.preventDefault();

        let $this = $(this);

        let href = $this.attr("href");
        history.pushState({page: 1}, $("title").text(), location.href);

        Centauri.Component.ATagComponent.ajaxRequest(href, () => {
            let seoUrl = Centauri.Utility.SeoUrlUtility($this.text());
            history.pushState({page: 1}, seoUrl, href);

            $(".nav-item.active").removeClass("active");

            let $navItem = $(".nav-item[data-uid='" + __dynPageData.uid + "']");

            if(Centauri.elExists($navItem)) {
                $navItem.addClass("active");
            }
        });
    });

    window.onpopstate = history.onpushstate = function(e) {
        let reqHref = location.href;

        if(reqHref != Centauri.Component.ATagComponent.lastHref) {
            Centauri.Component.ATagComponent.ajaxRequest(reqHref);
        }
    };

    $(window).bind("keydown", function(e) {
        let reload = false;
        let char = String.fromCharCode(e.which).toLowerCase();

        if(e.ctrlKey || e.metaKey) {
            if(char == "r") {
                reload = true;
            }
        }

        if(e.keyCode == 116 || e.key == "F5") {
            reload = true;
        }

        if(reload && Centauri.Component.ATagComponent.canReload) {
            e.preventDefault();

            Centauri.Component.ATagComponent.canReload = false;

            let href = Centauri.Component.ATagComponent.lastHref;
            Centauri.Component.ATagComponent.ajaxRequest(href, () => {
                setTimeout(() => {
                    Centauri.Component.ATagComponent.canReload = true;
                }, 1500);
            });
        } else if(!Centauri.Component.ATagComponent.canReload && reload) {
            e.preventDefault();
        }
    });
};

Centauri.Component.ATagComponent.lastHref = "";
Centauri.Component.ATagComponent.canReload = true;
Centauri.Component.ATagComponent.status = new Response().status;

Centauri.Component.ATagComponent.ajaxRequest = (href, cb) => {
    $(".progress").removeClass("inactive");

    $.ajax({
        type: "POST",
        url: href,

        data: {
            "dynPageRequest": true
        },

        success: (data) => {
            Centauri.Component.ATagComponent.loadPage(href, data, cb);
        },

        error: (jqXHR, textStatus, errorThrown) => {
            if(textStatus == "error") {
                let responseJSON = jqXHR.responseJSON;
                let responseText = jqXHR.responseText;

                let description = (typeof responseJSON != "undefined") ? responseJSON.message : "";

                if(
                    errorThrown == "unknown status" &&
                    description == "CSRF token mismatch."
                ) {
                    console.log("reload");
                    location.reload();
                } else {
                    if(errorThrown == "Not Found") {
                        Centauri.Component.ATagComponent.loadPage(href, responseText, cb);
                    } else {
                        Centauri.Notify("error", errorThrown, description);
                    }
                }
            }
        },

        complete: (jqXHR, textStatus) => {
            $(".progress").addClass("inactive");

            try {
                if(pageNotFound) {
                    location.reload();
                }
            } catch(e) {}
        }
    });
};

Centauri.Component.ATagComponent.loadPage = (href, data, cb = undefined) => {
    Centauri.Component.ATagComponent.lastHref = href;

    $("body section#content").html(data).promise().done(() => {
        $(".progress").toggleClass("inactive");

        if(typeof __dynPageData != "undefined") {
            $("title").text(__dynPageData.title);
        }

        if(Centauri.isNotUndefined(cb)) {
            cb();
        }

        Centauri.Event.OnWindowLoadEvent();
    });
};

/**
 * Component for responsive JavaScript calls.
 * 
 * Usage: Centauri.Component.MatchMediaComponent("screen", "min-width: 576px and (max-width: 991px)")
 * or:    Centauri.Component.MatchMediaComponent("screen", "above_lg");
 */
Centauri.Component.MatchMediaComponent = (breakpointsString, media="screen") => {
    let nBreakpointsString = breakpointsString;
    let privKeys = Centauri.Component.MatchMediaComponent.privKeys;

    Object.keys(privKeys).forEach((key) => {
        let value = privKeys[key];
        nBreakpointsString = nBreakpointsString.replace(key, value);
    });

    return window.matchMedia(media + " and " + nBreakpointsString).matches;
};

Centauri.Component.MatchMediaComponent.privKeys = {
    "above-xl": "(min-width: 1200px)",
    "below-xl": "(max-width: 1199px)",

    "above-lg": "(min-width: 992px)",
    "below-lg": "(max-width: 991px)",

    "above-md": "(min-width: 768px)",
    "below-md": "(max-width: 767px)",

    "above-sm": "(min-width: 576px)",
    "below-sm": "(max-width: 575px)",

    "above-xs": "(min-width: 575px)"
};

Centauri.Component.NavOnlineComponent = () => {
    
};

Centauri.Event.OnBreakpointChangeEvent = (_breakpoint) => {
    if(
        _breakpoint == "lg" ||
        _breakpoint == "xl"
    ) {
        if($("> .row", Centauri.Utility.ContentElementUtility("boxitems")).hasClass("slick-slider")) {
            $("> .row", Centauri.Utility.ContentElementUtility("boxitems")).slick("unslick");
        }
    } else {
        if(!$("> .row", Centauri.Utility.ContentElementUtility("boxitems")).hasClass("slick-slider")) {
            $("> .row", Centauri.Utility.ContentElementUtility("boxitems")).slick({
                arrows: false,
                dots: false,
                autoplay: true,
                speed: 750,
                autoplaySpeed: 6500
            });
        }
    }
};

Centauri.Event.OnHamburgerClickedEvent = () => {
    Centauri.Component.ATagComponent();
};

Centauri.Event.OnScrollEvent = () => {
    /**
     * Header Sticky
     */
    if($("html, body").scrollTop() > 75) {
        $("#header .container-fluid").removeClass("sticked");
    } else {
        $("#header .container-fluid").addClass("sticked");
    }
};

Centauri.Event.OnWindowLoadEvent = () => {
    Centauri.Service.PusherService();

    Centauri.Event.OnWindowResizeEvent();
    window.onresize = () => {
        Centauri.Event.OnWindowResizeEvent();
    };

    /**
     * Slider for CE: Slider
     */
    let $slider = Centauri.Utility.ContentElementUtility("slider");
    $slider.slick({
        dots: true,
        infinite: false,
        speed: 750,
        autoplay: true,
        autoplaySpeed: 4000,

        prevArrow: "<button class='waves-effect waves-light slick-prev slick-arrow' aria-label='Previous' type='button'><svg xmlns='http://www.w3.org/2000/svg' aria-hidden='true' focusable='false' data-prefix='fas' data-icon='chevron-left' class='svg-inline--fa fa-chevron-left fa-w-10' role='img' viewBox='0 0 320 512'><path fill='currentColor' d='M34.52 239.03L228.87 44.69c9.37-9.37 24.57-9.37 33.94 0l22.67 22.67c9.36 9.36 9.37 24.52.04 33.9L131.49 256l154.02 154.75c9.34 9.38 9.32 24.54-.04 33.9l-22.67 22.67c-9.37 9.37-24.57 9.37-33.94 0L34.52 272.97c-9.37-9.37-9.37-24.57 0-33.94z' /></svg></button>",
        nextArrow: "<button class='waves-effect waves-light slick-next slick-arrow' aria-label='Next' type='button'><svg xmlns='http://www.w3.org/2000/svg' aria-hidden='true' focusable='false' data-prefix='fas' data-icon='chevron-right' class='svg-inline--fa fa-chevron-right fa-w-10' role='img' viewBox='0 0 320 512'><path fill='currentColor' d='M285.476 272.971L91.132 467.314c-9.373 9.373-24.569 9.373-33.941 0l-22.667-22.667c-9.357-9.357-9.375-24.522-.04-33.901L188.505 256 34.484 101.255c-9.335-9.379-9.317-24.544.04-33.901l22.667-22.667c9.373-9.373 24.569-9.373 33.941 0L285.475 239.03c9.373 9.372 9.373 24.568.001 33.941z'/></svg></button>"
    });

    Centauri.Section.HeaderSection();

    setTimeout(() => {
        $slider.css("opacity", 1);
        Centauri.Component.ATagComponent();

        Centauri.Event.OnScrollEvent();
    }, 100);

    window.onscroll = () => {
        Centauri.Event.OnScrollEvent();
    };

    setTimeout(() => {
        Centauri.Service.LazyLoadService();
    }, 1500);

    Centauri.Utility.ImageUtility.preloadCachedImages();
    Waves.init();

    Centauri.Component.NavOnlineComponent();
};

Centauri.Event.OnWindowResizeEvent = () => {
    let _breakpoint = "xs";

    if(Centauri.Component.MatchMediaComponent("above-sm")) {
        _breakpoint = "sm";
    }
    if(Centauri.Component.MatchMediaComponent("above-md")) {
        _breakpoint = "md";
    }
    if(Centauri.Component.MatchMediaComponent("above-lg")) {
        _breakpoint = "lg";
    }
    if(Centauri.Component.MatchMediaComponent("above-xl")) {
        _breakpoint = "xl";
    }

    if(
        Centauri.Breakpoint != "" &&
        Centauri.Breakpoint != _breakpoint
    ) {
        Centauri.Breakpoint = _breakpoint;
    } else if(Centauri.Breakpoint == "") {
        Centauri.Breakpoint = _breakpoint;
    }

    Centauri.Event.OnBreakpointChangeEvent(_breakpoint);
};

