Centauri.Service.LazyLoadService = () => {
    $(".placeholder").each(function() {
        let $element = null;

        if(Centauri.elExists($("img", $(this)))) {
            $element = $("img", $(this));
        }

        if(Centauri.elExists($("div", $(this)))) {
            $element = $("div", $(this));
        }

        if(Centauri.isNotNull($element)) {
            if($element.is($("img"))) {
                let $img = $(this);

                if($img.inViewport()) {
                    $img = $("img", $img);
                    let src = $img.data("src");
                    let image = new Image();

                    $img.removeAttr("data-src");
                    $img.attr("src", src);

                    image.src = src;
                    image.onload = () => {
                        $img.parent().removeClass("placeholder");
                    };
                }   
            } else {
                console.warn("PlaceholderService has no support yet for: " + $element);
            }
        }
    });
};

Centauri.Service.PusherService = () => {
    // Pusher.logToConsole = true;

    // Connection
    let pusher = new Pusher("4f412ccc501bb244144b", {
        cluster: "eu",
        forceTLS: true
    });

    // Channel
    let channel = pusher.subscribe("centauri-channel");

    channel.bind("pagereload", (data) => {
        let message = data.message;

        if(Centauri.isNotUndefined(message["reloadpage"])) {
            if(message["reloadpage"]) {
                if(Centauri.Component.ATagComponent.canReload) {
                    Centauri.Component.ATagComponent.canReload = false;

                    let href = Centauri.Component.ATagComponent.lastHref;
                    Centauri.Component.ATagComponent.ajaxRequest(href, () => {
                        setTimeout(() => {
                            Centauri.Component.ATagComponent.canReload = true;
                        }, 1500);
                    });
                }
            }
        }
    });
};

Centauri.Service.UsedCSSService = () => {
    _getCSS = (a) => {
        let sheets = document.styleSheets, o = {};

        for(let i in sheets) {
            let rules = sheets[i].rules || sheets[i].cssRules;

            for(let r in rules) {
                if(a.is(rules[r].selectorText)) {
                    o = $.extend(o, self._CSS2Json(rules[r].style), self._CSS2Json(a.attr("style")));
                }
            }
        }

        return o;
    };

    _CSS2Json = (css) => {
        let s = {};

        if(!css) {
            return s;
        }

        if(css instanceof CSSStyleDeclaration) {
            for(let i in css) {
                if((css[i]).toLowerCase) {
                    s[(css[i]).toLowerCase()] = (css[css[i]]);
                }
            }
        } else if(typeof css == "string") {
            css = css.split("; ");

            for(let i in css) {
                let l = css[i].split(": ");
                s[l[0].toLowerCase()] = (l[1]);
            }
        }

        return s;
    };

    let _endCss = [];

    $("body *").each(function(index, obj) {
        let type = $(this).get(0).tagName;

        if(typeof type != "undefined") {
            type = type.toLowerCase();

            if(typeof obj == "object") {
                if(type != "script" && type != "style") {
                    let css = self._getCSS($(obj));

                    if(Object.keys(css).length > 0) {
                        _endCss.push({
                            element: $(obj),
                            css: css
                        });
                    }
                }
            }
        }
    });

    return _endCss;
};

