Centauri.Utility.ImageUtility = {
    addImage: (identifier, image) => {
        Centauri.Utility.ImageUtility.loadedImages[identifier] = true;

        Centauri.Utility.ImageUtility.images.push({
            identifier: identifier,
            image: image
        });
    },

    findImageByIdentifier: (identifier) => {
        if(Centauri.isNotUndefined(Centauri.Utility.ImageUtility.loadedImages[identifier])) {
            return Centauri.Utility.ImageUtility.loadedImages[identifier];
        }

        return null;
    },

    preloadCachedImages: () => {
        let images = Centauri.Utility.ImageUtility.images;

        $.each(images, (index, item) => {
            let $img = $("img[data-src='" + item.identifier + "']");
            $img.parent().removeClass("placeholder");

            $("<img class='img-fluid w-100' />").attr("src", item.image.src).insertAfter($img);
            $img.remove();

            // $img.attr("src", item.image.src);
            // $img.removeAttr("data-src");
        });
    }
};

Centauri.Utility.ImageUtility.images = [];
Centauri.Utility.ImageUtility.loadedImages = [];

Centauri.Utility.NotificationUtility = function(severity, title, description, options = {}) {
    return toastr[severity](title, description, options);
};

Centauri.Notify = function(severity, title, description, options = {}) {
    return Centauri.Utility.NotificationUtility(severity, title, description, options);
};

Centauri.Utility.SeoUrlUtility = (str) => {
    /**
     * Credits @ https://stackoverflow.com/a/48000411
     */
    return str.toString()                                                        // Convert to string
        .normalize("NFD")                                                        // Change diacritics
        .replace(/[\u0300-\u036f]/g, "")                                         // Remove illegal characters
        .replace(/\s+/g, "-")                                                    // Change whitespace to dashes
        .toLowerCase()                                                           // Change to lowercase
        .replace(/&/g, Centauri.Utility.SeoUrlUtility.Replacements.and)          // Replace ampersand
        .replace(/[^a-z0-9\-]/g, "")                                             // Remove anything that is not a letter,
                                                                                 // -> number or dash
        .replace(/-+/g, "-")                                                     // Remove duplicate dashes
        .replace(/^-*/, "")                                                      // Remove starting dashes
        .replace(/-*$/, "");                                                     // Remove trailing dashes
};

Centauri.Utility.SeoUrlUtility.Replacements = {
    and: "-"
};

$.fn.hasAttr = (attr) => {
    return (typeof $(this).attr(attr) != "undefined");
};

$.fn.inViewport = function() {
    let elementTop = $(this).offset().top;
    let elementBottom = elementTop + $(this).outerHeight();

    let viewportTop = $(window).scrollTop();
    let viewportBottom = viewportTop + $(window).height();

    return elementBottom > viewportTop && elementTop < viewportBottom;
};
